import tensorflow as tf
import numpy as np

"""se declaran los dos primeros arreglos con las entradas en celcius y las respectivas equivalencias en farenheit."""

celsius = np.array([-40,-10,0,8,15,22,38], dtype=float)
fahrenheit = np.array([-40,14,32,46,59,72,100], dtype=float)

"""![image_2022-02-16_211247.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

# units = unidades, neuronas
# input_shape = auto registra la capa de entrada con una neurona
#capa = tf.keras.layers.Dense(units=1, input_shape=[1])
# creamos el modelo
# usamos un modelo secuencial, existen muchos mas para redes neuronales mas avanzadas
# le pasamos al modelo las capas
#modelo = tf.keras.Sequential([capa]);

# otro ejemplo de como crear una red para resolver el mismo problema, pero con dos capas ocultas mas y 3 neuronas en cada una

oculta1 = tf.keras.layers.Dense(units = 3, input_shape = [1])
oculta2 = tf.keras.layers.Dense(units = 3)
salida = tf.keras.layers.Dense(units = 1)
modelo = tf.keras.Sequential([oculta1,oculta2,salida])

# vamos a compilar el modelo, lo que lo prepara para ser entrenado
# en la compilacion damos ajustes antes del aprendizaje para hacerlo mas eficiente

modelo.compile(
    # Adam es un algoritmo que le permite a la red neuronal saber como ajustar los pesos y sesgos de manera eficiente para aprender y no desaprender
    # el parametro es la tasa de aprendizaje, dice que tanto ajustar los pesos y sesgos (weigths and biases)
    optimizer=tf.keras.optimizers.Adam(0.1), 
    # funcion de perdida, error cuadratico medio, la funcion plantea que una poca cantidad de errores grandes es peor que una gran cantidad de errores pequeños
    loss='mean_squared_error' 

)

# entrenamiento
print("Comenzando entrenamiento...")
# epochs es el numero de vueltas que va a dar el entrenamiento
historial = modelo.fit(celsius, fahrenheit, epochs=1000, verbose=False)
print("Modelo entrenado!")

# resultado de la funcion de perdida, permite ver que tan mal estan los resultados de la red en cada vuelta que dio
import matplotlib.pyplot as plt
plt.xlabel('# Epoca')
plt.ylabel('Magnitud de perdida')
plt.plot(historial.history['loss'])



print("Hagamos una prediccion! ")
resultado = modelo.predict([100.0])
print("El resultado es " + str(resultado) + " fahrenheit!")

print("Variables internas del modelo")
#print(capa.get_weights())
print(oculta1.get_weights())
print(oculta2.get_weights())
print(salida.get_weights())
# nos muestra el peso y sesgo de nuestra red